import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './pages/auth/Login';
import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to="/login" />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<h1 className="text-center mt-10">Register Page (TODO)</h1>} />
        <Route path="/forgot-password" element={<h1 className="text-center mt-10">Forgot Password (TODO)</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
